import { useState } from 'react';
import './../../App.css';
import { Button, Container, Navbar } from 'react-bootstrap';
import { Nav } from 'react-bootstrap';
import { Form } from 'react-bootstrap';
import { Link } from 'react-router-dom';
const Header = ({ data }) => {

    const [active, setActive] = useState("");
 
  const handleClick = (event) => {
    setActive(event.target.innerText);
    
  }

    return (
        <div className="header-image"><pre>{process.env.REACT_APP_API_URL}</pre>
            <div className="App-header">
                {/* <img src   alt="logo" /> */}
                <p className='header-text text-white p-4'>{data}</p>
            </div>

            <div>
            <nav className="navbar navbar-dark bg-success">
        <div className="container" class="bg-primary">
          <Link className="navbar-brand" to="/">Assessment Demo</Link>
          <ul className="navbar-nav mr-auto">
            <li className="nav-item">
              <Link className="nav-link" to="/">Home</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/about">About Us</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/user">Users</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/contact">Contact Us</Link>
            </li>
           
          </ul>
        </div>
      </nav>
                    
                    {/* <nav class="navbar navbar-dark bg-success">
                            <Nav.Link href="/"><Button variant="outline-dark">
                                <strong>Home</strong>
                            </Button></Nav.Link>
                            <Nav.Link href="/about"><Button variant="outline-dark" >
                                <strong>About Us</strong>
                            </Button></Nav.Link>
                            <Nav.Link href="/user"><Button variant="outline-dark">
                                <strong>Customer</strong>
                            </Button></Nav.Link>
                            <Nav.Link href="/contact"><Button variant="outline-dark">
                                <strong>Contact Us</strong>
                            </Button></Nav.Link>

                        </nav> */}
                   
                 
            </div>
        </div>
    );
};

export default Header
